import React from 'react';
import { useParams } from 'react-router';
import { Route } from 'react-router-dom';

const QuoteDetail = () => {
    const params = useParams();
    return (
        <div>
            <h1>Quote Detail Pages</h1>
            <p>{params.quoteId}</p>
        </div>
    );
};

export default QuoteDetail;
